import React from 'react';
import { NavigationContainer } from "@react-navigation/native";
import { createDrawerNavigator } from '@react-navigation/drawer';
import { CreateListScreen, UserSettingsScreen, OneTimeListScreen, RegularListScreen } from '../screens';
import { CustomDrawer } from '../commons/CustomDrawer';
import { CreateStack } from './CreateStack';

export const RootDrawer = () => {

    const { Navigator, Screen } = createDrawerNavigator();
    return(
        <NavigationContainer>
            <Navigator
                drawerStyle={{ width: 300 }}
                drawerContent={(props) => (
                    <CustomDrawer />
                )} 
            >
                <Screen name="Add New List" component={CreateStack} />
                <Screen name="One Time List" component={OneTimeListScreen} />
                <Screen name="Regular List" component={RegularListScreen} />    
                <Screen name="User Settings" component={UserSettingsScreen} />
            </Navigator>
        </NavigationContainer>
    );
};
